      "content": "{\n  \"awards\": [\n    {\n      \"name\": \"CodeFest 3.0 Winner\",\n      \"organization\": \"24-Hour Hackathon\",\n      \"year\": \"2023\",\n      \"icon\": \"üèÜ\",\n      \"description\": \"Competed among 150 students in intensive 24-hour coding challenge\"\n    },\n    {\n      \"name\": \"IFLIX Hack (Jom Hack)\",\n      \"organization\": \"IFLIX\",\n      \"year\": \"2022\",\n      \"icon\": \"üíª\",\n      \"description\": \"Finalist in national hackathon competition\"\n    },\n    {\n      \"name\": \"ICT Project Trade Show\",\n      \"organization\": \"Highly Commended Project\",\n      \"year\": \"2017\",\n      \"icon\": \"‚≠ê\",\n      \"description\": \"Recognized for innovative ICT project solution\"\n    }\n  ],\n  \"certifications\": [\n    {\n      \"name\": \"Developing on AWS\",\n      \"provider\": \"Amazon Web Services\",\n      \"year\": \"2023\",\n      \"icon\": \"‚òÅÔ∏è\",\n      \"credentialUrl\": \"#\"\n    },\n    {\n      \"name\": \"Analyzing and Visualizing Data with Microsoft Power BI\",\n      \"provider\": \"Microsoft\",\n      \"year\": \"2022\",\n      \"icon\": \"üìä\",\n      \"credentialUrl\": \"#\"\n    },\n    {\n      \"name\": \"Building Scalable Java Microservices with Spring Boot and Spring Cloud\",\n      \"provider\": \"Spring Framework\",\n      \"year\": \"2021\",\n      \"icon\": \"‚öôÔ∏è\",\n      \"credentialUrl\": \"#\"\n    }\n  ]\n}"
