      "content": "{\n  \"awards\": [\n    {\n      \"name\": \"Ganador de CodeFest 3.0\",\n      \"organization\": \"Hackathon de 24 Horas\",\n      \"year\": \"2023\",\n      \"icon\": \"üèÜ\",\n      \"description\": \"Compet√≠ entre 150 estudiantes en desaf√≠o de codificaci√≥n intensivo de 24 horas\"\n    },\n    {\n      \"name\": \"IFLIX Hack (Jom Hack)\",\n      \"organization\": \"IFLIX\",\n      \"year\": \"2022\",\n      \"icon\": \"üíª\",\n      \"description\": \"Finalista en competencia nacional de hackathon\"\n    },\n    {\n      \"name\": \"ICT Project Trade Show\",\n      \"organization\": \"Proyecto Altamente Recomendado\",\n      \"year\": \"2017\",\n      \"icon\": \"‚≠ê\",\n      \"description\": \"Reconocido por soluci√≥n de proyecto TIC innovadora\"\n    }\n  ],\n  \"certifications\": [\n    {\n      \"name\": \"Desarrollo en AWS\",\n      \"provider\": \"Amazon Web Services\",\n      \"year\": \"2023\",\n      \"icon\": \"‚òÅÔ∏è\",\n      \"credentialUrl\": \"#\"\n    },\n    {\n      \"name\": \"An√°lisis y Visualizaci√≥n de Datos con Microsoft Power BI\",\n      \"provider\": \"Microsoft\",\n      \"year\": \"2022\",\n      \"icon\": \"üìä\",\n      \"credentialUrl\": \"#\"\n    },\n    {\n      \"name\": \"Creaci√≥n de Microservicios Java Escalables con Spring Boot y Spring Cloud\",\n      \"provider\": \"Spring Framework\",\n      \"year\": \"2021\",\n      \"icon\": \"‚öôÔ∏è\",\n      \"credentialUrl\": \"#\"\n    }\n  ]\n}\n"
