      "content": "{\n  \"awards\": [\n    {\n      \"name\": \"CodeFest 3.0 ‡§µ‡§ø‡§ú‡•á‡§§‡§æ\",\n      \"organization\": \"24-‡§ò‡§Ç‡§ü‡•á ‡§π‡•à‡§ï‡§æ‡§•‡•â‡§®\",\n      \"year\": \"2023\",\n      \"icon\": \"üèÜ\",\n      \"description\": \"150 ‡§õ‡§æ‡§§‡•ç‡§∞‡•ã‡§Ç ‡§ï‡•á ‡§∏‡§æ‡§• 24 ‡§ò‡§Ç‡§ü‡•á ‡§ï‡•Ä ‡§ó‡§π‡§® ‡§ï‡•ã‡§°‡§ø‡§Ç‡§ó ‡§ö‡•Å‡§®‡•å‡§§‡•Ä ‡§Æ‡•á‡§Ç ‡§™‡•ç‡§∞‡§§‡§ø‡§∏‡•ç‡§™‡§∞‡•ç‡§ß‡§æ\"\n    }\n  ],\n  \"certifications\": [\n    {\n      \"name\": \"AWS ‡§™‡§∞ ‡§µ‡§ø‡§ï‡§æ‡§∏\",\n      \"provider\": \"Amazon Web Services\",\n      \"year\": \"2023\",\n      \"icon\": \"‚òÅÔ∏è\",\n      \"credentialUrl\": \"#\"\n    }\n  ]\n}\n"
