      "content": "{\"awards\":[{\"name\":\"Pemenang CodeFest 3.0\",\"organization\":\"Hackathon 24 Jam\",\"year\":\"2023\",\"icon\":\"üèÜ\",\"description\":\"Berkompetisi dengan 150 mahasiswa dalam tantangan pengkodean intensif 24 jam\"},{\"name\":\"IFLIX Hack (Jom Hack)\",\"organization\":\"IFLIX\",\"year\":\"2022\",\"icon\":\"üíª\",\"description\":\"Finalist dalam kompetisi hackathon nasional\"},{\"name\":\"Trade Show Proyek ICT\",\"organization\":\"Proyek yang Sangat Dipuji\",\"year\":\"2017\",\"icon\":\"‚≠ê\",\"description\":\"Diakui karena solusi proyek ICT yang inovatif\"}],\"certifications\":[{\"name\":\"Mengembangkan di AWS\",\"provider\":\"Amazon Web Services\",\"year\":\"2023\",\"icon\":\"‚òÅÔ∏è\",\"credentialUrl\":\"#\"},{\"name\":\"Analisis dan Visualisasi Data dengan Microsoft Power BI\",\"provider\":\"Microsoft\",\"year\":\"2022\",\"icon\":\"üìä\",\"credentialUrl\":\"#\"}]}\n"
