      "isBinary": false,
      "content": "[{\"title\":\"Pengurus Projek Teknikal\",\"company\":\"FWD Insurance\",\"duration\":\"Ogos 2023 - Sekarang\",\"location\":\"Kuala Lumpur, Malaysia\",\"description\":[\"Memimpin pasukan penghantaran merentas sempadan, memastikan keselarasan di seluruh operasi wilayah\",\"Mendorong inisiatif penambahbaikan berterusan, mengurangkan tiket insiden lama sebanyak 15%\",\"Menguruskan pembangunan aplikasi React Native untuk modul DMS, OWB, dan UnderWrite Me\",\"Melaksanakan metodologi agile untuk mengoptimalkan aliran kerja dan menyesuaikan dengan permintaan projek\"],\"techStack\":[\"React Native\",\"Agile\",\"Project Management\",\"Cross-functional Teams\"],\"logo\":\"image/fwd-logo.png\"},{\"title\":\"Jurutera Perisian Kanan\",\"company\":\"Maybank\",\"duration\":\"Ogos 2021 - Ogos 2023\",\"location\":\"Kuala Lumpur, Malaysia\",\"description\":[\"Membangun dan menyelenggara aplikasi React.js, memastikan keselarasan dengan keperluan perniagaan\",\"Memanfaatkan React Hooks untuk membuat borang dinamik, mencapai pengurangan kos dalam pembangunan\",\"Menguruskan pangkalan kod, meluluskan penggabungan, dan memperuntukkan tugas untuk meningkatkan kecekapan pasukan\",\"Mereka bentuk dan melaksanakan API RESTful, meningkatkan fungsi aplikasi\"],\"techStack\":[\"React.js\",\"Redux\",\"RESTful APIs\",\"React Hooks\",\"Git\"],\"logo\":\"image/maybank-logo.png\"},{\"title\":\"Jurutera Perisian\",\"company\":\"Maybank\",\"duration\":\"November 2020 - Ogos 2021\",\"location\":\"Kuala Lumpur, Malaysia\",\"description\":[\"Membangun komponen React, Redux, Router, dan Axios untuk meningkatkan UI/UX\",\"Meningkatkan pengalaman pengguna dan kecepatan pemuatan sebanyak 15%\",\"Melaksanakan seni bina aplikasi satu halaman untuk skalabiliti\",\"Berkolaborasi dari jarak jauh menggunakan metodologi Agile dengan pasukan global\"],\"techStack\":[\"React\",\"Redux\",\"Axios\",\"SPA Architecture\",\"Agile\"],\"logo\":\"image/maybank-logo.png\"},{\"title\":\"Pembangun UI/UX\",\"company\":\"Maybank\",\"duration\":\"Januari 2019 - November 2020\",\"location\":\"Kuala Lumpur, Malaysia\",\"description\":[\"Membangun dan meningkatkan UI/UX menggunakan perpustakaan React, Redux, dan router\",\"Membuat komponen yang boleh digunakan semula dan skema data untuk mempermudah pembangunan\",\"Meningkatkan prestasi aplikasi dengan mereka bentuk penyelesaian antara muka biasa\",\"Meningkatkan modulariti projek melalui seni bina berasaskan komponen\"],\"techStack\":[\"React\",\"Redux\",\"UI/UX Design\",\"Component Architecture\"],\"logo\":\"image/maybank-logo.png\"},{\"title\":\"Pembangun Junior\",\"company\":\"Maybank\",\"duration\":\"Januari 2018 - Januari 2019\",\"location\":\"Kuala Lumpur, Malaysia\",\"description\":[\"Berkolaborasi dalam SDLC untuk meningkatkan kualiti produk\",\"Mengambil bahagian dalam semakan kod, meningkatkan teknik pengaturcaraan\",\"Menangani kerentanan keamanan siber memastikan pematuhan Bank Negara\",\"Menyokong integrasi API untuk pembaruan dan pembelian insurans\"],\"techStack\":[\"Java\",\"API Integration\",\"Security\",\"SDLC\"],\"logo\":\"image/maybank-logo.png\"}]\n"
