      "content": "{\n  \"awards\": [\n    {\n      \"name\": \"CodeFest 3.0 ‡∂¢‡∂∫‡∂ú‡∑ä‚Äç‡∂ª‡∑è‡∑Ñ‡∂ö\",\n      \"organization\": \"24-‡∂¥‡∑ê‡∂∫ ‡∑Ñ‡∑ê‡∂ö‡∂≠‡∑ú‡∂±‡∑ä\",\n      \"year\": \"2023\",\n      \"icon\": \"üèÜ\",\n      \"description\": \"150 ‡∑Å‡∑í‡∑Ç‡∑ä‚Äç‡∂∫‡∂∫‡∑í‡∂±‡∑ä‡∂ú‡∑ô‡∂±‡∑ä 24 ‡∂¥‡∑ê‡∂∫‡∑ö ‡∂≠‡∑ì‡∑Ä‡∑ä‚Äç‡∂ª ‡∂ö‡∑ö‡∂≠‡∂±‡∂∫ ‡∂Ö‡∂∑‡∑í‡∑Ñ‡∑ê‡∂∏‡∑î‡∑Ä‡∑ì‡∂∏‡∂ß ‡∂≠‡∂ª‡∂ü ‡∂ö‡∑í‡∂ª‡∑ì‡∂∏\"\n    },\n    {\n      \"name\": \"IFLIX Hack (Jom Hack)\",\n      \"organization\": \"IFLIX\",\n      \"year\": \"2022\",\n      \"icon\": \"üíª\",\n      \"description\": \"‡¶ú‡¶æ‡¶§‡ßÄ‡¶Ø‡¶º ‡∑Ñ‡∑ê‡∂ö‡∂≠‡∑ú‡∂±‡∑ä ‡∂≠‡∂ª‡∂ü‡∂∫‡∑ö ‡∂Ö‡∑Ä‡∑É‡∑è‡∂± ‡∂≠‡∑ö‡∂ª‡∂±‡∂∫‡∑ö ‡∑É‡∑í‡∂ß‡∑î‡∂∏\"\n    },\n    {\n      \"name\": \"ICT ‡∑Ä‡∑ä‚Äç‡∂∫‡∑è‡∂¥‡∑ò‡∂≠‡∑í ‡∑Ä‡∑ô‡∑Ö‡∂≥ ‡∂¥‡∑ä‚Äç‡∂ª‡∂Ø‡∂ª‡∑ä‡∑Å‡∂±‡∂∫\",\n      \"organization\": \"‡∂â‡∂≠‡∑è ‡∂¥‡∑ä‚Äç‡∂ª‡∑Å‡∂Ç‡∑É‡∑è ‡∂ö‡∂ª‡∂± ‡∂Ω‡∂Ø ‡∑Ä‡∑ä‚Äç‡∂∫‡∑è‡∂¥‡∑ò‡∂≠‡∑í‡∂∫\",\n      \"year\": \"2017\",\n      \"icon\": \"‚≠ê\",\n      \"description\": \"‡∂±‡∑Ä‡∑ì‡∂± ICT ‡∑Ä‡∑ä‚Äç‡∂∫‡∑è‡∂¥‡∑ò‡∂≠‡∑í ‡∑Ä‡∑í‡∑É‡∂≥‡∑î‡∂∏ ‡∑É‡∂≥‡∑Ñ‡∑è ‡∂¥‡∑í‡∑Ö‡∑í‡∂ú‡∑ê‡∂±‡∑ì‡∂∏\"\n    }\n  ],\n  \"certifications\": [\n    {\n      \"name\": \"AWS ‡∑Ñ‡∑í ‡∑É‡∂Ç‡∑Ä‡∂ª‡∑ä‡∂∞‡∂±‡∂∫\",\n      \"provider\": \"Amazon Web Services\",\n      \"year\": \"2023\",\n      \"icon\": \"‚òÅÔ∏è\",\n      \"credentialUrl\": \"#\"\n    },\n    {\n      \"name\": \"Microsoft Power BI ‡∑É‡∂∏‡∂ü ‡∂Ø‡∂≠‡∑ä‡∂≠ ‡∑Ä‡∑í‡∑Å‡∑ä‡∂Ω‡∑ö‡∑Ç‡∂´ ‡∑É‡∑Ñ ‡∂Ø‡∑ô‡∂ö‡∂≠‡∂±‡∂ö‡∂ª‡∂´‡∂∫\",\n      \"provider\": \"Microsoft\",\n      \"year\": \"2022\",\n      \"icon\": \"üìä\",\n      \"credentialUrl\": \"#\"\n    }\n  ]\n}\n"
