      "content": "{\n  \"awards\": [\n    {\n      \"name\": \"CodeFest 3.0 ‡Æµ‡ØÜ‡Æ±‡Øç‡Æ±‡Æø‡ÆØ‡Ææ‡Æ≥‡Æ∞‡Øç\",\n      \"organization\": \"24-‡ÆÆ‡Æ£‡Æø‡Æ®‡Øá‡Æ∞ ‡Æπ‡Øç‡¶Ø‡Ææ‡Æï‡Øç‡Æï‡Æ§‡Øç‡Æ§‡Æ©‡Øç\",\n      \"year\": \"2023\",\n      \"icon\": \"üèÜ\",\n      \"description\": \"150 ‡ÆÆ‡Ææ‡Æ£‡Æµ‡Æ∞‡Øç‡Æï‡Æ≥‡ØÅ‡Æü‡Æ©‡Øç 24 ‡ÆÆ‡Æ£‡Æø‡Æ®‡Øá‡Æ∞ ‡Æ§‡ØÄ‡Æµ‡Æø‡Æ∞ ‡Æï‡ØÅ‡Æ±‡Æø‡ÆØ‡Ææ‡Æï‡Øç‡Æï ‡Æö‡Æµ‡Ææ‡Æ≤‡Æø‡Æ≤‡Øç ‡Æ™‡Øã‡Æü‡Øç‡Æü‡Æø\"\n    },\n    {\n      \"name\": \"IFLIX Hack (Jom Hack)\",\n      \"organization\": \"IFLIX\",\n      \"year\": \"2022\",\n      \"icon\": \"üíª\",\n      \"description\": \"‡Æ§‡Øá‡Æö‡Æø‡ÆØ ‡Æπ‡Øç‡¶Ø‡Ææ‡Æï‡Øç‡Æï‡Æ§‡Øç‡Æ§‡Æ©‡Øç ‡Æ™‡Øã‡Æü‡Øç‡Æü‡Æø‡ÆØ‡Æø‡Æ≤‡Øç ‡Æá‡Æ±‡ØÅ‡Æ§‡Æø\"\n    },\n    {\n      \"name\": \"ICT ‡Æ§‡Æø‡Æü‡Øç‡Æü ‡Æï‡Æ£‡Øç‡Æï‡Ææ‡Æü‡Øç‡Æö‡Æø\",\n      \"organization\": \"‡ÆÆ‡Æø‡Æï ‡Æ™‡Ææ‡Æ∞‡Ææ‡Æü‡Øç‡Æü‡Æ™‡Øç‡Æ™‡Æü‡Øç‡Æü ‡Æ§‡Æø‡Æü‡Øç‡Æü‡ÆÆ‡Øç\",\n      \"year\": \"2017\",\n      \"icon\": \"‚≠ê\",\n      \"description\": \"‡Æ™‡ØÅ‡Æ§‡Æø‡ÆØ ICT ‡Æ§‡Æø‡Æü‡Øç‡Æü ‡Æ§‡ØÄ‡Æ∞‡Øç‡Æµ‡ØÅ‡Æï‡Øç‡Æï‡ØÅ ‡ÆÖ‡Æô‡Øç‡Æï‡ØÄ‡Æï‡Ææ‡Æ∞‡ÆÆ‡Øç\"\n    }\n  ],\n  \"certifications\": [\n    {\n      \"name\": \"AWS ‡Æá‡Æ≤‡Øç ‡ÆÆ‡Øá‡ÆÆ‡Øç‡Æ™‡Ææ‡Æü‡ØÅ\",\n      \"provider\": \"Amazon Web Services\",\n      \"year\": \"2023\",\n      \"icon\": \"‚òÅÔ∏è\",\n      \"credentialUrl\": \"#\"\n    },\n    {\n      \"name\": \"Microsoft Power BI ‡ÆÆ‡ØÇ‡Æ≤‡ÆÆ‡Øç ‡Æ§‡Æ∞‡Æµ‡ØÅ ‡Æ™‡Æï‡ØÅ‡Æ™‡Øç‡Æ™‡Ææ‡ÆØ‡Øç‡Æµ‡ØÅ ‡ÆÆ‡Æ±‡Øç‡Æ±‡ØÅ‡ÆÆ‡Øç ‡Æï‡Ææ‡Æü‡Øç‡Æö‡Æø‡Æ™‡Øç‡Æ™‡Æü‡ØÅ‡Æ§‡Øç‡Æ§‡Æ≤‡Øç\",\n      \"provider\": \"Microsoft\",\n      \"year\": \"2022\",\n      \"icon\": \"üìä\",\n      \"credentialUrl\": \"#\"\n    }\n  ]\n}\n"
