      "content": "{\n  \"name\": \"Kuhandran SamudraPandiyan - Technical Delivery Manager\",\n  \"short_name\": \"Kuhandran\",\n  \"description\": \"Technical Delivery Manager & Full-Stack Engineer with 8+ years in enterprise applications, React Native, and banking solutions. Progressive Web App with offline support.\",\n  \"start_url\": \"/\",\n  \"scope\": \"/\",\n  \"display\": \"standalone\",\n  \"orientation\": \"portrait-primary\",\n  \"background_color\": \"#ffffff\",\n  \"theme_color\": \"#3b82f6\",\n  \"prefer_related_applications\": false,\n  \"icons\": [\n    {\n      \"src\": \"/logo.svg\",\n      \"sizes\": \"any\",\n      \"type\": \"image/svg+xml\",\n      \"purpose\": \"any\"\n    }\n  ],\n  \"screenshots\": [\n    {\n      \"src\": \"https://static.kuhandranchatbot.infoimage/profile.webp\",\n      \"sizes\": \"400x400\",\n      \"type\": \"image/webp\",\n      \"form_factor\": \"narrow\"\n    }\n  ],\n  \"categories\": [\"technology\", \"business\", \"productivity\"],\n  \"screenshots_wide\": [\n    {\n      \"src\": \"https://static.kuhandranchatbot.infoimage/profile.webp\",\n      \"sizes\": \"1280x720\",\n      \"type\": \"image/webp\",\n      \"form_factor\": \"wide\"\n    }\n  ],\n  \"shortcuts\": [\n    {\n      \"name\": \"View Portfolio\",\n      \"short_name\": \"Portfolio\",\n      \"description\": \"View featured projects and case studies\",\n      \"url\": \"/?view=portfolio\",\n      \"icons\": [{ \"src\": \"/logo.svg\", \"sizes\": \"any\", \"type\": \"image/svg+xml\" }]\n    },\n    {\n      \"name\": \"Contact Me\",\n      \"short_name\": \"Contact\",\n      \"description\": \"Get in touch with Kuhandran\",\n      \"url\": \"/?view=contact\",\n      \"icons\": [{ \"src\": \"/logo.svg\", \"sizes\": \"any\", \"type\": \"image/svg+xml\" }]\n    }\n  ],\n  \"share_target\": {\n    \"action\": \"/share\",\n    \"method\": \"POST\",\n    \"enctype\": \"multipart/form-data\",\n    \"params\": {\n      \"title\": \"title\",\n      \"text\": \"text\",\n      \"url\": \"url\"\n    }\n  }\n}\n"
